INSERT INTO "duel_client_setting_m" VALUES('block_assist_judge','アシスト特技による判定強化の効果を受け取る','他のプレイヤーから「判定がかなり強化される」アシスト特技が送られた時、その効果を受け取るか選択でき\nます。OFFにすると、自分のライブで「判定がかなり強化される」アシスト特技の効果が適応されなくなりま\nす。',0);
INSERT INTO "duel_client_setting_m" VALUES('mute_stamp_voice','スタンプボイスを再生する','スタンプのボイス（音声）を再生するか選択できます。\nOFFにすると、スタンプが表示されてもボイスが再生しません。この設定は他のプレイヤーを待っている間、\nスピーカーボタンをタップして変更することも可能です。',1);
INSERT INTO "duel_client_setting_m" VALUES('cut_fever_time_effect','フィーバータイム時、画面にエフェクトを表示する','フィーバータイム中に画面に専用のエフェクト演出を表示するかの選択ができます。\nOFFにすると、表示されなくなります。',2);
